import React from "react";

function NavBar() {
  return (
    <>
    <h3>
      <strong>Mega Man Games</strong>
    </h3>

    <h3>
        <strong>Spinoffs</strong>
    </h3>

    <h3>
        <strong>Cameos</strong>
    </h3>
    </>
  );
}

export default NavBar;
